const data=[
    {
        image:"data:image/jpeg;base64,",
        movieTitle: "Wood",
        rating:"Rating:5"
      
    },
    {
        image:"data:image/jpeg;base64,",
        movieTitle: "Pirates",
        rating:"Rating:5"
      
    },
    {
        image:"data:image/jpeg;base64,",
        movieTitle:"Joker",
        rating:"Rating:5"

    }
]
     
     const movieBox=document.getElementById("Show_movies");
    //data.map((el)=>{
      //    const div=document.createElement("div");
     //     const image=document.createElement("img");
     //     image.src=el.image;
    //}
    for(let i=0;i<data.length;i++)
    {
          const div=document.createElement("div");
          const image=document.createElement("img");
          image.src=data[i].image;
          const movieTitle=document.createElement("h3");
          movieTitle.innerText=data[i].movieTitle;
          const rating=document.createElement("p");
          rating.innerText=data[i].rating;
          const button=document.createElement("button");
          button.innerText="Click Movie";
          button.addEventListener("click",()=>{
            alert(`You clicked on ${data[i].movieTitle}`);
          });
          div.append(image,movieTitle,rating,button);
          movieBox.append(div);
    }
    
